function CV() {
  return (
    <section id="cv">
    <h2>Mon CV</h2>
    <embed id="pdf" src="CV_BARBOSA_Mathias.pdf" width="800" height="1100" type="application/pdf"></embed>
    </section>
  );
}

export default CV;
